import { IMemberTier } from "@interfaces";
import styled from "styled-components";

interface IProps {
    avatar: string;
    fullName: string;
    memberTier: IMemberTier | undefined;
}

export const ComponentTIerDetail = (props: IProps) => {
    const { avatar, fullName, memberTier } = props;

    return (
        <StyledTierDetail>
            <div className="avatar">
                <div className="image">
                    <img src={avatar} />
                </div>
                <div className="info">
                    <div className="name">{fullName}</div>
                    <div className="rank">{memberTier?.tierName}</div>
                </div>
            </div>
        </StyledTierDetail>
    );
};

const StyledTierDetail = styled.div`
    .avatar {
        padding: 32px 0;
        background-color: #fff;
        display: flex;
        align-items: center;
        .image {
            margin: 0 16px;
            img {
                border-radius: 50%;
            }
        }
        .info {
            .name {
                font-family: "Roboto", sans-serif;
                font-style: normal;
                font-weight: bold;
                font-size: 20px;
                color: #000000;
            }
        }
    }
`;
